declare const SQL_QUERY = "\nINSERT INTO Account (\n  \"accountType\", \"accountId\", \"createdAt\", \"updatedAt\", \"deletedAt\", \"personId\"\n) VALUES (\n  @accountType, @accountId, @createdAt, @updatedAt, @deletedAt, @personId\n)\nON CONFLICT (\"personId\", \"accountType\", \"accountId\") DO UPDATE SET\n\"createdAt\" = MIN(@createdAt, \"createdAt\"), \"updatedAt\" = MAX(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\")\n";
export default SQL_QUERY;
